import React from "react";

const DeliveryDatesSchedule = () => {
    return (
        <div className="container flex-container">
            <div className="row">
                <div className="col-md-1" />
                <div className="col-md-5" id="chat-text" style={{ marginTop: "100px" }}>
                    <h2 style={{ color: 'white', fontSize: 45 }}>Delivery Dates/Schedule</h2>
                    <p style={{ color: 'white', fontSize: 45 }}>Production Delivery Schedule/Calendar<br />
                    Delivery Date Window for Retailer Shipping<br /></p>
                </div>
                <div className="col-md-5">
                    <img id="chat-image" src="images/stylist.jpg" alt='chat' />
                </div>
                <div className="col-md-1" />
            </div>
        </div>
    )
}
export default DeliveryDatesSchedule;
